'use strict';
import totalEnergyConsumption from "./totalEnergyConsumption.js";
import totalEnergyProduction from "./totalEnergyProduction.js";
import production from "./production.js";
import chinamap from "./Chinamap.js";
import * as d3 from "d3";
import csv1 from "./assets/total energy consumption.csv";
import csv2 from "./assets/total energy production.csv";
import csv3 from "./assets/production.csv";
import csv4 from "./assets/china.json";

//能源消费总量及构成
d3.csv(csv1).then((data, error) => {
  if (error) {
    console.log(error);
  } else {
    console.log(data);
    totalEnergyConsumption(data, {

    });
  };
});

// 全国各地区能源生产量
d3.csv(csv2).then((data, error) => {
  if (error) {
    console.log(error);
  } else {
    // 默认年份
    const data0 = d3.filter(data, d => { if (d["年份"] == 2015) return d; });

    // 创建绘图函数
    const drawChart = (data) => {
      // 清空原有的图表
      d3.select("#svg2").selectAll("*").remove();

      totalEnergyProduction(data, {});

    };
    // 绘制初始图表
    drawChart(data0);

    // 监听下拉列表的选择变化
    d3.select("#yearSelect1").on("change", function () {
      const selectedYear = this.value;
      const selectedData = d3.filter(data, d => {
        if (d["年份"] == selectedYear) return d;
      });
      drawChart(selectedData);
    });

  }
});

d3.csv(csv3).then((data, error) => {
  if (error) {
    console.log(error);
  } else {
    //默认年份
    const data0 = d3.filter(data, d => { if (d["年份"] == 2015) return d; });
    const type0 = d3.filter(data, d => { if (d["年份"] == 2015) return d; });

    //冒泡排序
    var ex;
    for (var i = 0; i < 30; i++) {
      for (var j = 29; j >= i; j--) {
        if (+data0[j].原煤生产量 < +data0[j + 1].原煤生产量) {
          ex = data0[j];
          data0[j] = data0[j + 1];
          data0[j + 1] = ex;
        }
      }
    }
    //切割数据，取前12个
    const data01 = data0.slice(0, 12);

    // 创建绘图函数
    const drawChart = (data) => {
      // 清空原有的图表
      d3.select("#svg3").selectAll("*").remove();

      production(data, {});

    };
    // 绘制初始图表
    drawChart(data01);

    // 监听下拉列表的选择变化
    d3.select("#yearSelect2").on("change", function () {
      const selectedYear = this.value;
      const selectedData = d3.filter(data, d => {
        if (d["年份"] == selectedYear) return d;
      });
      //冒泡排序
      var ex;
      for (var i = 0; i < 30; i++) {
        for (var j = 29; j >= i; j--) {
          if (+selectedData[j].原煤生产量 < +selectedData[j + 1].原煤生产量) {
            ex = selectedData[j];
            selectedData[j] = selectedData[j + 1];
            selectedData[j + 1] = ex;
          }
        }
      }
      //切割数据，取前12个
      const selectedData1 = selectedData.slice(0, 12);



      drawChart(selectedData1);
    });

  }
});



// 全国各地区能源生产量
d3.csv(csv3).then((data, error) => {
  if (error) {
    console.log(error);
  } else {
    // 默认年份
    let selectedYear;
    let selectedData = d3.filter(data, d => { if (d["年份"] == 2015) return d; });
    let selectedType = 1;

    // 创建绘图函数
    const drawChart = (data, source) => {
      // 清空原有的图表
      d3.select("#svg4").selectAll("*").remove();

      chinamap(csv4, data, source, {});

    };
    // 绘制初始图表
    drawChart(selectedData, selectedType);

    // 监听下拉列表的选择变化

    d3.select("#yearSelect3").on("change", function () {
      selectedYear = this.value;
      selectedData = d3.filter(data, d => {
        if (d["年份"] == selectedYear) return d;
      });
      drawChart(selectedData, selectedType);
    });

    d3.select("#typeSelect3").on("change", function () {
      selectedType = this.value;
      drawChart(selectedData, selectedType);
    });

  }
});
